import React from "react";
import { Link } from "react-router-dom";

const ProductsList = () => {
  return (
    <>
      <h1>Products</h1>
      <Link to="/books/1">Book1</Link>
      <Link to="/books/2">Book2</Link>
    </>
  );
};

export default ProductsList;
